# gatsby-transformer-csv

Parses CSV files into JSON arrays.

## Install

`npm install --save gatsby-transformer-csv`

## How to use

```javascript
// In your gatsby-config.js
plugins: [
  `gatsby-transformer-csv`,
]
```
Above is the minimal configuration required to begin working. Additional customization
of the parsing process is possible using the parameters listed in
[csvtojson](https://github.com/Keyang/node-csvtojson#parameters).

```javascript
// In your gatsby-config.js
plugins: [
  {
    resolve: `gatsby-transformer-csv`,
    options: {
      noheader: true
    }
  }
]
```

## Parsing algorithm

Each row is converted into a node with CSV headers as the keys.

So if your project has a `letters.csv` with
```
letter,value
a,65
b,66
c,67
```
the following three nodes would be created.

```javascript
[
  { letter: 'a', value: 65, type: 'LettersCsv' },
  { letter: 'b', value: 66, type: 'LettersCsv' },
  { letter: 'c', value: 67, type: 'LettersCsv' },
]
```

## How to query

You'd be able to query your letters like:

```graphql
{
  allLettersCsv {
    edges {
      node {
        letter
        value
      }
    }
  }
}
```

Which would return:

```javascript
{
  allLettersCsv: {
    edges: [
      {
        node: {
          letter: 'a'
          value: 65
        }
      },
      {
        node: {
          letter: 'b'
          value: 66
        }
      },
      {
        node: {
          letter: 'c'
          value: 67
        }
      }
    ]
  }
}
```

# gatsby-transformer-json

Parses JSON files. Supports arrays of objects and single objects.

## Install

`npm install --save gatsby-transformer-json`

You also need to have `gatsby-source-filesystem` installed and configured so it points to your files.

## How to use

```javascript
// In your gatsby-config.js
plugins: [
  `gatsby-transformer-json`,
]
```

## Parsing algorithm

You can choose to structure your data as arrays of objects in individual files
or as single objects spread across multiple files.

### Array of Objects

The algorithm for arrays is to convert each item in the array into
a node.

So if your project has a `letters.json` with `[{ "value": "a" }, { "value":
"b" }, { "value": "c" }]` then the following three nodes would be created.

```javascript
[
  { value: 'a', type: 'Letters' },
  { value: 'b', type: 'Letters' },
  { value: 'c', type: 'Letters' },
]
```

### Single Object

The algorithm for single JSON objects is to convert the object defined at the
root of the file into a node. The type of the node is based on the name of the
parent directory.

For example, lets say your project has a data layout like:

```
data/
    letters/
        a.json
        b.json
        c.json
```

Where each of `a.json`, `b.json` and `c.json` look like:

```javascript
{ 'value': 'a' }
```

```javascript
{ 'value': 'b' }
```

```javascript
{ 'value': 'c' }
```

Then the following three nodes would be created.

```javascript
[
  {
    value: 'a',
    type: 'Letters',
  },
  {
    value: 'b',
    type: 'Letters',
  },
  {
    value: 'c',
    type: 'Letters',
  },
]
```

## How to query

Regardless of whether you choose to structure your data in arrays of objects or
single objects, you'd be able to query your letters like:

```graphql
{
  allLettersJson {
    edges {
      node {
        value
      }
    }
  }
}
```

Which would return:

```javascript
{
  allLettersJson: {
    edges: [
      {
        node: {
          value: 'a'
        }
      },
      {
        node: {
          value: 'b'
        }
      },
      {
        node: {
          value: 'c'
        }
      }
    ]
  }
}
```

# gatsby-transformer-javascript-static-exports

Parses JavaScript files to extract data from exports.

## Install

`npm install --save gatsby-transformer-javascript-static-exports`

## How to use

```javascript
// In your gatsby-config.js
plugins: [
  `gatsby-transformer-javascript-static-exports`,
]
```

## Parsing algorithm

The algorithm for uses babylon and traverse (from the babel family of code) to statically read the data exports.

In a .js file, export a data object to set your metadata variables, like so:
```javascript
import React from 'react'

exports.data = {
    title: 'Choropleth on d3v4',
    written: '2017-05-04',
    layoutType: 'post',
    path: 'choropleth-on-d3v4',
    category: 'data science',
    description: 'Things about the choropleth.'
}

export default MyComponent ...
```

You can also use a named export for the data object:

```javascript
export const data = {
    title: 'Choropleth on d3v4',
    written: '2017-05-04',
    layoutType: 'post',
    path: 'choropleth-on-d3v4',
    category: 'data science',
    description: 'Things about the choropleth.'
}
```

## How to query

You'd be able to query your data like:

```graphql
{
  allJsFrontmatter {
    edges {
      node {
        data {
          error
          path
          title
          written
          category
          description
          updated
        }
      }
    }
  }
}
```

Which would return something like:

```javascript
{
  "data": {
    "allJsFrontmatter": {
      "edges": [
        {
          "node": {
            "data": {
              "error": false,
              "path": "choropleth-on-d3v4",
              "title": "Choropleth on d3v4",
              "written": "2017-05-04",
              "category": "data science",
              "description": "Things about the choropleth.",
              "updated": null
            }
          }
        }
      ]
    }
  }
}
```

Any attribute on "data" across your js files will be exported. If a file is missing it, the value will be null.

The error field will contain `false` or an object with error information just to give a surface level view of what the query is pulling out.

```javascript
"error": {
          "err": true,
          "message": "we threw an error",
          "stack": "This is a stringified stack trace"
        },
```

# gatsby-transformer-excel

Parses Excel files into JSON arrays.

## Install

`npm install --save gatsby-transformer-excel`

## How to use

```javascript
// In your gatsby-config.js
plugins: [
  `gatsby-transformer-excel`,
]
```

## Parsing algorithm

The parsing is powered by the [SheetJS / js-xlsx](https://git.io/xlsx) library.
Each row of each worksheet is converted into a node whose keys are determined
by the first row and whose type is determined by the name of the worksheet.

So if your project has a `letters.xlsx` with two worksheets:

```
------ Sheet1 ------
/|    A    |   B   |
-+---------+-------+
1| letter  | value |
-+---------+-------+
2|    a    |   97  |
-+---------+-------+
3|    b    |   98  |

------ Sheet2 ------
/|    A    |   B   |
-+---------+-------+
1| letter  | value |
-+---------+-------+
2|    A    |   65  |
-+---------+-------+
3|    B    |   66  |
```

the following nodes would be created:

```javascript
[
  { letter: 'a', value: 97, type: 'LettersXlsxSheet1' },
  { letter: 'b', value: 98, type: 'LettersXlsxSheet1' },
  { letter: 'A', value: 65, type: 'LettersXlsxSheet2' },
  { letter: 'B', value: 66, type: 'LettersXlsxSheet2' },
]
```

## How to query

You'd be able to query your letters like:

```graphql
{
  allLettersXlsxSheet1 {
    edges {
      node {
        letter
        value
      }
    }
  }
}
```

Which would return:

```javascript
{
  allLettersXlsxSheet1: {
    edges: [
      {
        node: {
          letter: 'a'
          value: 97
        }
      },
      {
        node: {
          letter: 'b'
          value: 98
        }
      },
    ]
  }
}
```

